import "./App.css";
import NavigateMenu from "./component/NavigateMenu/NavigateMenu";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function App() {
  return (
    <Router>
      <div className="App">
        <NavigateMenu listCategory={[]}></NavigateMenu>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/product">
            <Users />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
          <Route path="/news">
            <News />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
